library(shiny)
library(tidyverse)


listado_paises <- c("Alemania", "Francia")



ui <- fluidPage(
  # Titulo
  tags$head(
    tags$style(
      HTML(".shiny-notification {
              height: 100px;
              width: 800px;
              position:fixed;
              top: calc(50% - 50px);;
              left: calc(50% - 400px);;
            }
           "
      )
    )
  ),
  titlePanel("Emisiones de Deuda Publica"),
  tabsetPanel(
    id = "main_tabset",
    tabPanel(
      "Inicio"
    ),
    
    ## Información de entidades ----
    tabPanel("Deuda de los principales países de la zona euro",
             sidebarLayout(
               sidebarPanel(
                 width=3,
                 selectizeInput(
                   inputId = "seleccionar_pais",
                   label = "Seleccionar pais",
                   choices = listado_paises,
                   list(placeholder = 'Introduce pais a mostrar...'),
                   options = list(maxOptions =  4,
                                  maxItems=1),
                   multiple = F
                 ),
                 
                 selectInput(
                   inputId = "seleccionar_plazo",
                   label="Seleccionar plazo...",
                   choices =listado_paises,
                   multiple = TRUE
                 ),
                 selectizeInput(
                   inputId = "pais_comparar_con",
                   label = "Seleccionar pais de comparación...",
                   choices = listado_paises,
                   list(placeholder = 'Introduce país con las que comparar'),
                   options = list(maxOptions =  2,
                                  maxItems=2),
                   multiple = TRUE
                 )
               ),
               mainPanel(
                 ggiraphOutput("emisionesPlot")
               )
             )
    ),
  )
)





